"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     Paired mid-esophageal apical four-chamber movie clips&nbsp;with and without color Doppler imaging from intraoperative transesophageal echocardiogram (TEE). The images show a relatively empty heart on cardiopulmonary bypass during intraoperative placement of an Amplatzer muscular VSD device. The device has been positioned using a perventricular approach, introducing the sheath and later the device through the right ventricular wall using TEE guidance. The device&nbsp;is well seated on the septum and remains attached to the delivery cable at this point in the procedure. Color Doppler imaging shows no significant residual shunting in the region of the VSD closure device.",
"    </p>",
