var title_f38_50_39723="Mechanism exercise on mortality";
var content_f38_50_39723=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F51658&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F51658&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Possible biologic mechanisms for exercise-induced reductions in all-cause and cardiac mortality",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Cardiovascular influences",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reduction of resting and exercise heart rate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reduction of resting and exercise blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reduction of myocardial oxygen demand at submaximal levels of physical activity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Expansion of plasma volume",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increase in myocardial contractility",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increase in peripheral venous tone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Favorable changes in fibrinolytic system",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased endothelium-dependent vasodilation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased gene expression for nitric oxide synthase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Enhanced parasympathetic tone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Possible increases in coronary blood flow, coronary collateral vessels, and myocardial capillary density",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Metabolic influences",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reduction of obesity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Enhanced glucose tolerance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Improved lipid profile",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Lifestyle influences",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Decreased liklihood of smoking",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Possible reduction of stress",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Short-term reduction of appetite",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Shepard RJ, Balady GJ. Circulation 1999; 99:963.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
