var title_f38_50_39724="Cell associated pattern recognition receptors";
var content_f38_50_39724=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F66228&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F66228&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major PRRs: Cell-associated",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        PRR",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recognize",
"       </td>",
"       <td class=\"subtitle1\">",
"        Functions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Plasma membrane-bound",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Toll-like receptors (TLRs) 1,2,4,5,6",
"       </td>",
"       <td>",
"        Variety of microbial PAMPs",
"       </td>",
"       <td>",
"        Cytokine release, activation of immune cells",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Macrophage scavenger receptor",
"       </td>",
"       <td>",
"        Gram-negative and Gram-positive bacteria",
"       </td>",
"       <td>",
"        Cytokine release, activation of immune cells",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Macrophage mannose receptor",
"       </td>",
"       <td>",
"        Microbial mannan",
"       </td>",
"       <td>",
"        Opsonization of bacteria, fungi",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dectin-1",
"       </td>",
"       <td>",
"        Fungal &beta;-glucan",
"       </td>",
"       <td>",
"        Opsonization of bacteria, fungi",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Formyl peptide receptor",
"       </td>",
"       <td>",
"        Bacterial membrane N-formylmethionine",
"       </td>",
"       <td>",
"        Opsonization and microbial lysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Intracellular (cytoplasmic or endolysosomal)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        TLRs 3,7,8,9,10",
"       </td>",
"       <td>",
"        Variety of microbial PAMPs",
"       </td>",
"       <td>",
"        Cytokine release, activation of immune cells",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        NOD-like receptors (NLRs) (NOD1 and 2)",
"       </td>",
"       <td>",
"        Bacterial cell wall peptidoglycan, MDP",
"       </td>",
"       <td>",
"        Cytokine release, immune cell activation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        RIG-I-like receptors (RLRs) (RIG-I)",
"       </td>",
"       <td>",
"        Viral dsRNA",
"       </td>",
"       <td>",
"        Clearance of RNA and DNA viruses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        MDA5",
"       </td>",
"       <td>",
"        Viral dsRNA",
"       </td>",
"       <td>",
"        Clearance of RNA viruses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        LGP2",
"       </td>",
"       <td>",
"        Viral RNA",
"       </td>",
"       <td>",
"        Clearance of RNA viruses",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Additional plasma membrane receptors that typically do not react directly with microbes but play an important role in innate host defense are the complement receptors that bind activated (cleaved) C3 (C3b and C3bi), which mediate opsonization, and the macrophage receptor for phosphatidyl serine, which aids recovery from inflammation by removing apoptotic cells. Complement receptor 3 (CR3) can bind &beta;-glucan in fungal cell wall at a site distinct from its complement-binding site, but the biologic significance of this binding is not yet proven.",
"    <div class=\"footnotes\">",
"     ds: double-stranded; LGP2: laboratory of genetics and physiology 2; MDA5: melanoma differentiation-associated gene 5; NOD: nucleotide-binding oligomerization domain; RIG-I: retinoic acid-inducible gene I.",
"    </div>",
"    <div class=\"reference\">",
"     Original figure modified for this publication. Reproduced from: Liu, AH, Zasloff, MA, Johnston, RB Jr. Innate immunity. In: Middleton's Allergy: Principles and Practice, 7th ed, Adkinson, NF Jr, Busse, WW, Bochner, BS, et al (Eds), Elsevier 2008. Illustration used with the permission of Elsevier, Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
