var title_f38_50_39726="HDV HBV reinfxn in liver TPL";
var content_f38_50_39726=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F74844&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F74844&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 541px\">",
"   <div class=\"ttl\">",
"    Hepatitis D virus and hepatitis B virus reinfection after liver transplantation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 521px; height: 431px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A patient who underwent transplantation for HDV cirrhosis developed HBV recurrence at eight months. Acute hepatitis (AH) occurred two months later with expression of HDAg in the liver. Serum HDV-RNA became detectable at 13 months. The patient progressed to chronic active hepatitis (CAH) with persistence of detectable HBV and HDV replication seven years after grafting. ALT, alanine aminotransferases; hatched area, upper limit of normal for ALT.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Samuel, D, Zignego, AL, Reynes, M, et al, Hepatology 1995; 21:334.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
